import React, { FC, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {useDropzone, FileWithPath } from 'react-dropzone';
import Slider from '@mui/material/Slider';
import { getMessage } from '../utils/api';
import { isAuthenticated } from '../utils/auth';
import Grid2 from '@mui/material/Unstable_Grid2'; // Grid version 2
import Paper from '@mui/material/Paper';
import { styled } from '@mui/material/styles';
import Typography from '@mui/material/Typography';
import Box from '@mui/material/Box';


const useStyles = makeStyles((theme) => ({
  link: {
    color: '#61dafb',
  },
  column: {
    margin: '10px',
    backgroundColor: '#F8F9F9 !important',
    border: '2px dashed #D3D3D3',
    minHeight: '50vh',
  }

}));

export const Home: FC = () => {
  const [message, setMessage] = useState<string>('');
  const [error, setError] = useState<string>('');
  const classes = useStyles();

  const queryBackend = async () => {
    try {
      const message = await getMessage();
      setMessage(message);
    } catch (err) {
      setError(String(err));
    }
  };

  const {acceptedFiles, getRootProps, getInputProps} = useDropzone();

  const files = acceptedFiles.map((file: FileWithPath) => (
    <li key={file.path}>
      {file.path} - {file.size} bytes
    </li>
  ));

  const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));

  const PrettoSlider = styled(Slider)({
    color: '#52af77',
    height: 10,
    '& .MuiSlider-track': {
      border: 'none',
    },
    '& .MuiSlider-thumb': {
      height: 24,
      width: 24,
      backgroundColor: '#fff',
      border: '2px solid currentColor',
      '&:focus, &:hover, &.Mui-active, &.Mui-focusVisible': {
        boxShadow: 'inherit',
      },
      '&:before': {
        display: 'none',
      },
    },
    '& .MuiSlider-valueLabel': {
      lineHeight: 1.2,
      fontSize: 12,
      background: 'unset',
      padding: 0,
      width: 32,
      height: 32,
      borderRadius: '50% 50% 50% 0',
      backgroundColor: '#52af77',
      transformOrigin: 'bottom left',
      transform: 'translate(50%, -100%) rotate(-45deg) scale(0)',
      '&:before': { display: 'none' },
      '&.MuiSlider-valueLabelOpen': {
        transform: 'translate(50%, -100%) rotate(-45deg) scale(1)',
      },
      '& > *': {
        transform: 'rotate(45deg)',
      },
    },
  });

  return (
    <>
      {/* {!message && !error && (
        <a className={classes.link} href="#" onClick={() => queryBackend()}>
          Click to make request to backend
        </a>
      )}
      {message && (
        <p>
          <code>{message}</code>
        </p>
      )}
      {error && (
        <p>
          Error: <code>{error}</code>
        </p>
      )} */}
      <Grid2 container spacing={3} columns={12}>
        <Grid2 xs={6}>
          <Item className={classes.column}>
            <section className="container">
              <div {...getRootProps({className: 'dropzone'})}>
                <input {...getInputProps()} />
                <p>Drag 'n' drop some files here, or click to select files</p>
              </div>
              <aside>
                <h4>Files</h4>
                <ul>{files}</ul>
              </aside>
            </section>
          </Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>Test</Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>
            <Box sx={{ width: 320 }}>
              <Typography gutterBottom>Box Threshold</Typography>
              <PrettoSlider
                valueLabelDisplay="auto"
                aria-label="pretto slider"
                defaultValue={20}
              />
            </Box>
            <Typography gutterBottom>Text Threshold</Typography>
            <Slider max={1} min={0} defaultValue={0.25} step={0.1} aria-label="Default" valueLabelDisplay="on" sx={{ width: 600, color:"#D3D3D3"}} />
          </Item>
        </Grid2>
        <Grid2 xs={6}>
          <Item className={classes.column}>Test</Item>
        </Grid2>
      </Grid2>
      <a className={classes.link} href="/admin">
        Admin Dashboard
      </a>
      <a className={classes.link} href="/protected">
        Protected Route
      </a>
      {isAuthenticated() ? (
        <a className={classes.link} href="/logout">
          Logout
        </a>
      ) : (
        <>
          <a className={classes.link} href="/login">
            Login
          </a>
          <a className={classes.link} href="/signup">
            Sign Up
          </a>
        </>
      )}
    </>
  );
};
